  <style>
    * { margin: 0; padding: 0; box-sizing: border-box; }

      top: 0;

      display: flex;
      align-items: center;
      justify-content: center;

      pointer-events: auto;

      transform: scale(var(--zoom-scale, 1));
      
    }
    #watermark.image-mode {
      background: none;
      padding: 0;
    }
    #watermark img {
      max-width: 100%;
      max-height: 100%;
      object-fit: contain;
      width: 200px;

    @media (min-resolution: 120dpi) {

    @media (min-resolution: 144dpi) {
      #watermark { --zoom-scale: 1.5; }

      #watermark { --zoom-scale: 2; }
